import React, { useState } from "react";
import axios from "axios";
import useRazorpay from "react-razorpay";


export const SinhagadBooking = () => {
    const [trekDetails, setTrekDetails] = useState({
        name:"Sinhagad",
        date:"15/05/2024",
        price:499
    })

    const [firstName, setFirstName] = useState('')
    const [lastName, setLastName] = useState('')
    const [address, setAddress] = useState('')
    const [pincode, setPincode] = useState('')
    const [email, setEmail] = useState('')
    const [phone, setPhone] = useState('')


    const [Razorpay] = useRazorpay();
    const initPay = (data) => {
        const options = {
          key : "rzp_test_axvMsqlpqBjktG",
          amount: data.amount,
          currency: data.currency,
          name: trekDetails.name,
          description: "Test",
          order_id: data.id,
          handler: async (response) => {
            try {
              const verifyURL = "http://localhost:8080/api/payment/verify";
              const {data} = await axios.post(verifyURL,response);
            } catch(error) {
              console.log(error);
            }
          },
          theme: {
            color: "#ac21ee",
          },
        };
        const rzp1 = new Razorpay(options);
        rzp1.open();
      };

    const handlePay = async () => {
        try {
          const orderURL = "http://localhost:8080/api/payment/orders";
          const {data} = await axios.post(orderURL,{amount: trekDetails.price});
          console.log(data);
          initPay(data.data);
        } catch (error) {
          console.log(error);
        }
    };

    return <div className="ml-[65px] mt-12 font-Quicksand">
        <form action="">
            <div className="mb-4 font-LeagueSpartan text-[25px] font-medium text-zinc-800">Would love to know you better!</div>
            <div className="flex justify-between w-10/12">
                <div className="">
                    <div className="text-zinc-400 text-[15px]">First Name</div>
                    <input className="border-2 rounded-[4px] text-[15px] font-medium py-1 px-2 border-zinc-300 w-[240px]" type="text" />
                </div>
                <div className="">
                    <div className="text-zinc-400 text-[15px]">Last Name</div>
                    <input className="border-2 rounded-[4px] text-[15px] font-medium py-1 px-2 border-zinc-300 w-[240px]" type="text" />
                </div>
            </div>
            <div className="mt-4">
                <div className="text-zinc-400 text-[15px]">Address</div>
                <input className="border-2 rounded-[4px] text-[15px] font-medium py-1 px-2 border-zinc-300 w-10/12" type="text" />
            </div>
            
            <div className="flex justify-between w-10/12 mt-4">
                <div className="">
                    <div className="text-zinc-400 text-[15px]">Pincode</div>
                    <input className="border-2 rounded-[4px] text-[15px] font-medium py-1 px-2 border-zinc-300 w-[240px]" type="number" />
                </div>
                <div className="">
                    <div className="text-zinc-400 text-[15px]">Age</div>
                    <input className="border-2 rounded-[4px] text-[15px] font-medium py-1 px-2 border-zinc-300 w-[240px]" type="number" />
                </div>
            </div>
            <div className="mt-4">
                <div className="text-zinc-400 text-[15px]">Email</div>
                <input className="border-2 rounded-[4px] text-[15px] font-medium py-1 px-2 border-zinc-300 w-10/12" type="text" />
            </div>
            <div className="mt-4">
                <div className="text-zinc-400 text-[15px]">Phone Number</div>
                <input className="border-2 rounded-[4px] text-[15px] font-medium py-1 px-2 border-zinc-300 w-10/12" type="number" />
            </div>
            <div className="uppercase mt-10 w-10/12 py-2 cursor-pointer hover:text-red-500 text-center bg-black text-white" onClick={handlePay}>
                    pay
                </div>
            
        </form>
    </div>
}
